const Actions = styled.div`
	display: flex;
`;
const UserProfile = ({ setIsLoggedIn }) => {
	const logOut = useCallback(() => {
		setIsLoggedIn(false);
	}, []);
	return (
		<Card>
			<Actions></Actions>
		</Card>
	);
};

export default UserProfile;
